						["custom"] = "function(event, timestamp, subevent, sourceGUID, sourceName, sourceFlags, destGUID, destName, destFlags,death,...)\n    \n    -- print(subevent..\" On \" .. death)\n    if subevent == \"SPELL_DAMAGE\" then\n        if aura_env.kills[death] == 2 then \n            aura_env.kills[death] = 1\n            aura_env.emitMessage(death..\"1\")\n        end\n    end\n    \n    if subevent == \"UNIT_DIED\" then\n        if aura_env.kills[death] == 1 or aura_env.kills[death] == 2 then \n            aura_env.kills[death] = 0\n            aura_env.emitMessage(death)\n        end\n    end\n    \nend\n\n\n--Credits \n--Th-Golemagg",
