						["custom"] = "function(e, ...)\n    if (e == \"UPDATE_BATTLEFIELD_STATUS\" or e == \"PLAYER_ENTERING_WORLD\") then\n        local Status, Map, InstanceID = GetBattlefieldStatus(1)\n        \n        if Status == \"confirm\" then        \n            aura_env.emitPlayerWithBG(StaticPopup1.text.text_arg1);    \n            -- Player Has Queue\n            -- Emit BG Info To Guild            \n        else\n            -- Player Doesn't Have Queue\n            -- Emit No Queue To Guild\n            aura_env.emitPlayerWithoutBG();\n        end\n    end\n    \n    if (e == \"CHAT_MSG_ADDON\") then\n        local prefix = select(1, ...);\n        local text = select(2, ...);\n        local channel = select(3, ...);\n        local sender = select(4, ...);        \n        \n        if (prefix == aura_env.prefix and aura_env.channelEnabled(channel)) then\n            \n            -- Update BGs Table\n            if (text == \"NoBG\") then\n                aura_env.removePlayerFromBGs(sender);\n            else\n                aura_env.addPlayerToBGs(sender, text);\n            end\n        end\n    end\n    \n    aura_env.text = aura_env.createText(aura_env.bgs);\n    \n    return aura_env.text ~= \"\";\nend",
