				["displayText"] = "%c",
				["customText"] = "function()\n    return dump(aura_env.kills)\nend\n\n\n--Credits \n--Th-Golemagg",
				["yOffset"] = 148,
				["anchorPoint"] = "CENTER",
				["customTextUpdate"] = "update",
				["url"] = "https://wago.io/KBnDQaCbs/5",
				["actions"] = {
					["start"] = {
					},
					["init"] = {
						["custom"] = "aura_env.kills = {[\"Lieutenant Rugba\"] = 2,[\"Drek'Thar\"]=2,[\"Captain Galvangar\"]=2, [\"Lieutenant Grummus\"]=2,[\"Lieutenant Vol'talar\"]=2,[\"Lieutenant Lewis\"]=2,[\"Lieutenant Stronghoof\"]=2,[\"Lieutenant Murp\"]=2,[\"Commander Louis Philips\"]=2,[\"Commander Dardosh\"]=2,[\"Commander Malgor\"]=2,[\"Commander Mulfort\"]=2}\n--forgot rugba\naura_env.prefix = \"TrackStuff\"\n--C_ChatInfo.RegisterAddonMessagePrefix(aura_env.prefix)\n\nfunction strdo(s, name, v) \n    if v == 1 then\n        return s .. \"|cFFFFFF00\".. name  .. '\\n' --yello\n    elseif v == 2 then \n        return s .. \"|cFFFF0000\".. name  .. '\\n' --red\n    else\n        return s .. \"|cFF2BFF00\".. name  .. '\\n' --green\n    end\nend \n\nfunction dump(o)\n    st = \"|cFFFFFFFFFirst Pull\\n\"\n    st = strdo(st, \"Captain Galvangar\",aura_env.kills[\"Captain Galvangar\"])\n    st = strdo(st, \"Lieutenant Grummus\",aura_env.kills[\"Lieutenant Grummus\"])\n    st = strdo(st, \"Lieutenant Vol'talar\",aura_env.kills[\"Lieutenant Vol'talar\"])\n    st = strdo(st, \"Lieutenant Lewis\",aura_env.kills[\"Lieutenant Lewis\"])\n    st = st .. \"|cFFFFFFFFSecond Pull\\n\"\n    st = strdo(st, \"Lieutenant Rugba\",aura_env.kills[\"Lieutenant Rugba\"])\n    st = strdo(st, \"Lieutenant Stronghoof\",aura_env.kills[\"Lieutenant Stronghoof\"])\n    st = strdo(st, \"Lieutenant Murp\",aura_env.kills[\"Lieutenant Murp\"])\n    st = strdo(st, \"Commander Louis Philips\",aura_env.kills[\"Commander Louis Philips\"])\n    st = strdo(st, \"Commander Dardosh\",aura_env.kills[\"Commander Dardosh\"])\n    st = st .. \"|cFFFFFFFFThird Pull\\n\"\n    st = strdo(st, \"Commander Malgor\",aura_env.kills[\"Commander Malgor\"])\n    st = strdo(st, \"Commander Mulfort\",aura_env.kills[\"Commander Mulfort\"])\n    st = strdo(st, \"Drek'Thar\",aura_env.kills[\"Drek'Thar\"])\n    return st\nend\n\n\naura_env.emitMessage = function(msg)\n    --if (UnitInParty(\"player\")) then\n    --    C_ChatInfo.SendAddonMessage(aura_env.prefix, msg, \"PARTY\")\n    --end\n    --if (IsInRaid()) then\n    --    C_ChatInfo.SendAddonMessage(aura_env.prefix, msg, \"RAID\") \n    --end\n    C_ChatInfo.SendAddonMessage(aura_env.prefix, msg, \"INSTANCE_CHAT\") --disabled in classic lul\nend\n\n--Credits \n--Th-Golemagg",
						["do_custom"] = true,
