						["custom"] = "aura_env.bgs = {};\naura_env.text = \"\";\n\naura_env.prefix = \"shiiViehoewi\";\nC_ChatInfo.RegisterAddonMessagePrefix(aura_env.prefix)\n\naura_env.addPlayerToBGs = function(name, bg)\n    aura_env.bgs[name] = bg;\nend\n\naura_env.removePlayerFromBGs = function(name)\n    aura_env.bgs[name] = nil;\nend\n\naura_env.createText = function(bgs)\n    local bgTotal = {};\n    local bgNames = {};\n    local str = \"\";\n    local unavailableCount = 0;\n    local myName = gsub(UnitName(\"player\"), \"%-[^|]+\", \"\");\n    local leaders = {};\n    leaders[\"Who\"] = 1;\n    leaders[\"Hakke\"] = 2;\n    leaders[\"Tornia\"] = 3;\n    leaders[\"Cathantis\"] = 4;\n    local bgLeader = \"\"\n    \n    local position = UnitInBattleground(\"player\");\n    if (position ~= nil) then\n        for i = 1, MAX_RAID_MEMBERS do\n            local playerName = GetRaidRosterInfo(i);\n            if (leaders[playerName] ~= nil) then\n                if (bgLeader == \"\") then\n                    bgLeader = playerName;\n                else\n                    if (leaders[playerName] < leaders[bgLeader]) then\n                        bgLeader = playerName;\n                    end\n                end\n            end\n        end\n        for i = 1, MAX_RAID_MEMBERS do\n            local playerName, rank = GetRaidRosterInfo(i);\n            if (rank == 2 and playerName == myName and playerName ~= bgLeader) then\n                local output = \"|cffff0000YOU ARE LEADER - PASS TO |r|cff40C7EB\" .. bgLeader .. \"|r\\n\";\n                output = output .. output;\n                output = output .. output;\n                output = output .. output;\n                return output;\n            end\n        end\n        return \"\";\n    end\n    \n    for name, bg in pairs(bgs) do\n        local trimmedName = gsub(name, \"%-[^|]+\", \"\");\n        if (bgTotal[bg] == nil) then\n            bgTotal[bg] = 0;\n            bgNames[bg] = {};\n            \n        end\n        bgTotal[bg] = bgTotal[bg] + 1;\n        bgNames[bg][trimmedName] = true;\n    end\n    \n    local biggestBg = nil\n    local biggestCount = 0;\n    for bg, count in pairs(bgTotal) do\n        if (count > biggestCount) then\n            biggestCount = count;\n            biggestBg = bg\n        end\n    end\n    \n    for bg, count in pairs(bgTotal) do\n        if (aura_env.config.names) then\n            local names = \"\"\n            for name, _ in pairs(bgNames[bg]) do\n                names = names .. name .. \", \";\n            end\n            \n            if (names ~= \"\") then\n                names = names:sub(1, -3);\n            end\n            \n            str = string.format(\"%s%s (%s) [%d]\\n\", str, bg, names, count);\n        else\n            if (biggestCount == count) then\n                if (bgNames[bg][myName] ~= true)  then\n                    str = string.format(\"%s|cffb3000c%s (%d)|r\\n\", str, bg, count);\n                else\n                    str = string.format(\"%s|cff008000%s (%d)|r\\n\", str, bg, count);\n                end\n            else\n                str = string.format(\"%s%s (%d)\\n\", str, bg, count);\n            end\n        end\n    end\n    \n    if (aura_env.config.missing and biggestCount > (GetNumGroupMembers(LE_PARTY_CATEGORY_HOME) * 2) / 3) then\n        local missingNames = \"\";\n        local line = \"\";\n        local deserter = \"\";\n        for i = 1, MAX_RAID_MEMBERS do\n            local playerName, _, _, _, class, _, _, online = GetRaidRosterInfo(i);\n            if (playerName ~= nil) then\n                local trimmedPlayerName = gsub(playerName, \"%-[^|]+\", \"\");\n                \n                if (bgNames[biggestBg][trimmedPlayerName] ~= true) then\n                    local _, _, _, colorHex = GetClassColor(string.upper(class));\n                    \n                    local hasDeserter = false;\n                    for j=1,4 do\n                        local _, _, _, _, _, _, _, _, _, spellId = UnitDebuff(\"raid\" .. i,j)\n                        if (spellId == 26013) then\n                            hasDeserter = true;\n                            unavailableCount = unavailableCount + 1;\n                            if (string.len(deserter) ~= 0) then\n                                deserter = deserter .. \", \";\n                            end\n                            deserter = deserter .. \"|c\" .. colorHex .. trimmedPlayerName .. \"|r\"\n                        end\n                    end\n                    \n                    if (hasDeserter == false) then\n                        if (string.len(line) ~= 0) then\n                            line = line .. \", \";\n                        end\n                        \n                        if (online ~= true) then\n                            unavailableCount = unavailableCount + 1;\n                            colorHex = \"ff7e7d7d\";\n                            trimmedPlayerName = \"*\" .. trimmedPlayerName .. \"*\";\n                        end\n                        line = line .. \"|c\" .. colorHex .. trimmedPlayerName .. \"|r\";\n                        if (string.len(line) > 50) then\n                            missingNames = missingNames .. line .. \"\\n\";\n                            line = \"\";\n                        end\n                    end\n                end\n            end\n        end\n        missingNames = missingNames .. line;\n        str = string.format(\"%s\\n\\nMissing:\\n%s\", str, missingNames);\n        if (deserter ~= \"\" and aura_env.config.deserter) then\n            str = string.format(\"%s\\n\\nDeserter: %s\", str, deserter);\n        end\n    end\n    if (string.len(str) ~= 0) then\n        if (unavailableCount == 0) then\n            str = string.format(\"Total Players: %d\\n%s\", GetNumGroupMembers(LE_PARTY_CATEGORY_HOME), str);\n        else\n            str = string.format(\"Total Players: %d (+%d)\\n%s\", GetNumGroupMembers(LE_PARTY_CATEGORY_HOME) - unavailableCount, unavailableCount, str);\n        end\n    end\n    \n    return str;\nend\n\naura_env.emitMessage = function(msg)\n    if (UnitInParty(\"player\")) then\n        C_ChatInfo.SendAddonMessage(aura_env.prefix, msg, \"PARTY\")\n    end\n    if (IsInRaid()) then\n        C_ChatInfo.SendAddonMessage(aura_env.prefix, msg, \"RAID\")\n    end\nend\n\naura_env.emitPlayerWithBG = function(bg)\n    aura_env.emitMessage(bg);\nend\n\naura_env.emitPlayerWithoutBG = function()\n    aura_env.emitMessage(\"NoBG\");\nend\n\naura_env.channelEnabled = function(channel)\n    return ((channel == \"PARTY\" and aura_env.config.party) or (channel == \"RAID\" and aura_env.config.raid))\nend",
